INSERT INTO `features` (`id`, `title`, `description`, `image`, `icon`, `type`, `created_at`, `updated_at`) VALUES
	(1, 'Business Needs.', '<p>Manage your projects and your talent in a single system, resulting in empowered teams, satisfied clients, and increased profitability.</p>', NULL, NULL, 'image', '2019-08-09 19:53:34', '2019-08-09 19:53:34'),
	(2, 'Reports', '<p>Reports section to analyse what\'s working and what\'s not for your business</p>', NULL, NULL, 'image', '2019-08-09 19:53:34', '2019-08-09 19:53:34'),
	(3, 'Tickets', '<p>Whether someone\'s internet is not working, someone is facing issue with housekeeping or need something regarding their work they can raise ticket for all their problems. Admin can assign the tickets to respective department agents.</p>', NULL, NULL, 'image', '2019-08-09 19:53:34', '2019-08-09 19:53:34'),
	(4, 'Responsive', 'Your website works on any device: desktop, tablet or mobile.', NULL, 'fas fa-desktop', 'icon', '2019-08-09 19:53:34', '2019-08-09 19:53:34'),
	(5, 'Customizable', 'You can easily read, edit, and write your own code, or change everything.', NULL, 'fas fa-wrench', 'icon', '2019-08-09 19:53:34', '2019-08-09 19:53:34'),
	(6, 'UI Elements', 'There is a bunch of useful and necessary elements for developing your website.', NULL, 'fas fa-cubes', 'icon', '2019-08-09 19:53:34', '2019-08-09 19:53:34'),
	(7, 'Clean Code', 'You can find our code well organized, commented and readable.', NULL, 'fas fa-code', 'icon', '2019-08-09 19:53:34', '2019-08-09 19:53:34'),
	(8, 'Documented', 'As you can see in the source code, we provided a comprehensive documentation.', NULL, 'far fa-file-alt', 'icon', '2019-08-09 19:53:34', '2019-08-09 19:53:34'),
	(9, 'Free Updates', 'When you purchase this template, you\'ll freely receive future updates.', NULL, 'fas fa-download', 'icon', '2019-08-09 19:53:34', '2019-08-09 19:53:34');
